import logo from './logo.svg';
import './App.css';
import React from 'react';




class Game extends React.Component {
  render() {
    return (
      <div className="game">
        <div className="game-board">
          <Board />
        </div>
        <div className="game-info">
          <h3>
            This is a big header
          </h3>
        </div>
      </div>
    );
  }
}

function App() {
  return (
    <div className="App">
      <div className="game-board">
        <Board />
      </div>
    </div>
  );
}



export default App;
